//pages/Nav.js
import React from "react";
import './banner.css';
function banner() {
  function gotoBannerInfo(){
    window.location.href = "https://www.provin.gangwon.kr/gw/portal/sub07_12_04_08_01";
  }
  return (

    <button id = "banner" onClick = {gotoBannerInfo}>
        
    </button>
  );
}

export default banner;
